  `apply_message` varchar(200) NOT NULL DEFAULT '' COMMENT '管理员审核信息',
  `apply_year` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '开店时长(年)',
  `shop_type_name` varchar(50) NOT NULL DEFAULT '' COMMENT '店铺等级名称',
